import React, {useState, useEffect} from "react";
import Title from "../Title"
import ItemCount from "../ItemCount";
import ItemList from "../ItemList";
import { useParams } from "react-router-dom";

const funkos = [
    {
        id: 1, image: "data:image/jpeg;base64,", category:"funkos",
        title: "Funko Pop Allmight"
    },
    {
        id: 2, image: "data:image/jpeg;base64,", category:"funkos",
        title: "Funko Pop Jinx"
    },
    {
        id: 3, image: "data:image/jpeg;base64,", category:"funkos",
        title: "Funko Pop Naruto 6 Caminos"
    },
    {
        id:4 , image:"data:image/jpeg;base64,", category:"figuras", title: "Figura Jhin"
    },
    {
        id: 5, image:"data:image/jpeg;base64,", category:"figuras", title:"Figura Thresh"
    },
    {
        id: 6, image:"data:image/jpeg;base64,", category:"figuras", title:"Figura Goku UI"
    },

];

export const ItemListContainer = (props) => {
    const [data, setData] = useState ([]);

    const {categoriaId} = useParams();

    useEffect (() => {
      const getData = new Promise(resolve => {
        setTimeout(() => {
         resolve (funkos);
        }, 1000);
      });
      if (categoriaId) {
     getData.then(res => setData ( res.filter(funko => funko.category === categoriaId)));
    } else {
        getData.then(res => setData(res))
     }

    }, [categoriaId])

    const onAdd = (quantity) => {
        console.log("Compraste $(quantity) unidades");
    }
    return (
        <>
            <Title greeting={props.texto} />
            <ItemCount initial={1} stock={5} onAdd={onAdd} />
            <ItemList data={data} />
        </>
    );
}

export default ItemListContainer;